"use strict";(self.webpackChunknyu_cs_wiki=self.webpackChunknyu_cs_wiki||[]).push([[9659],{1398:e=>{e.exports=JSON.parse('{"label":"Social","permalink":"/docs/tags/social","allTagsPath":"/docs/tags","count":2,"items":[{"id":"Opportunities/Internships/competitive_programming","title":"Competitive Programming","description":"Competitive programming is a great way to improve your problem solving skills and prepare for technical interviews. It is also a great way to meet other students who are interested in computer science. While there are teams at both CAS and Tandon, any student can join either (or both) clubs.","permalink":"/docs/Opportunities/Internships/competitive_programming"},{"id":"Opportunities/VIP/vip","title":"Vertically Integrated Projects","description":"Vertically Integrated Projects (VIP) are a unique long-term and large-scale project led by a faculty member at NYU. After applying, accepted students enroll in a VIP course in Albert like any other class. VIP can be taken for credit, usually 1. Up to 6 credits can be earned over multiple semesters. Different VIP teams have different needs and requirements. Generally, you can expect to spend a couple hours per week on VIP. VIP is a great way to get involved in research and work on a project that you are passionate about. VIP is also a great way to meet other students and faculty.","permalink":"/docs/Opportunities/VIP/"}]}')}}]);